column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
nmcli JSON yapılandırma verisi ve yapılandırma içeren bir dosyayı kabul edebilir. İkinci durumda dosya okunur ve içeriği bu özelliğe konur.

Örnekler: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
Kullanım: nmcli general { KOMUT | help }

KOMUT := { status | hostname | permissions | logging }

  status

  hostname [<makine_adi>]

  permissions

  logging [level <log seviyesi>] [domains <log alanları>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
Kullanım: nmcli general status { help }

NetworkManager için genel durumları gösterir.
'status' varsayılan eylemdir, yani 'nmcli gen' aslında 'nmcli gen status' komutunu çağırır

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
Kullanım: nmcli networking { KOMUT | help }

KOMUT := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio { COMMAND | help }

COMMAND := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column3:
Kullanım: nmcli radio { KOMUT | help }

KOMUT := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
Kullanım: nmcli radio all { DEĞİŞKENLER | help }

DEĞİŞKENLER := [on | off]

Tüm radyo anahtarlarının durumunu gösterir, ya da açar/kapatır.

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
Kullanım: nmcli radio wifi { DEĞİŞKENLER | help }

DEĞİŞKENLER := [on | off]

Wi-Fi radyo anahtarının durumunu gösterir, ya da açar/kapar.

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
Kullanım: nmcli radio wwan { DEĞİŞKENLER | help }

DEĞİŞKENLER := [on | off]

Mobil geniş bant radyo anahtarınının durumunu gösterir, ya da açar/kapatır.
